import React from "react";
import { Link } from "react-router-dom";

const Header = () => {
  return (
    <header className="header">
      <nav>
        <div className="logo">
          <img
            src="https://brandradiator.com/images/BR-logo1.png"
            height="40"
          />
        </div>
        <input type="checkbox" id="menu-toggle" />
        <label for="menu-toggle" className="menu-icon">
          &#9776;
        </label>
        <ul className="menu">
          <li>
            <Link to="/">Home</Link>
          </li>
          <li>
            {/* <a href="#">About</a> */}
            <Link></Link>
          </li>
          <li>
            <a href="#">Contact Us</a>
          </li>
          <li>
            <a href="#">Admin</a>
          </li>
        </ul>
      </nav>
    </header>
  );
};

export default Header;
